import './App.css';
import {Route,Routes, useNavigate ,} from 'react-router-dom'
import Addnew from './components/Addnew';
import Home from './components/Home';
function App() {

  return (
    <div>
    <Routes>
      <Route path="/Addnew" element={<Addnew />} />
      <Route path="/" element={<Home />} />
    </Routes>
    </div>
  );
}

export default App;
